// ExerciseLibrary.js

import React from 'react';
import frontSquatImg from './images/front-squat.jpg';
import lungesImg from './images/lunges.jpg';
import legPressImg from './images/leg-press.jpg';
import legCurlImg from './images/leg-curl.jpg';
import pullUpImg from './images/pull-up.jpg';
import deadliftImg from './images/deadlift.jpg';
import rowImg from './images/row.jpg';
import latPullImg from './images/lat-pull.jpg';
import pushUpImg from './images/push-up.jpg';
import benchPressImg from './images/bench-press.jpg';
import inclinePressImg from './images/incline-press.jpg';
import chestFlyImg from './images/chest-fly.jpg';

const exerciseData = [
  {
    muscle: 'Legs',
    exercises: [
      { name: 'Front Squat', image: frontSquatImg },
      { name: 'Lunges', image: lungesImg },
      { name: 'Leg Press', image: legPressImg },
      { name: 'Leg Curl', image: legCurlImg }
    ]
  },
  {
    muscle: 'Back',
    exercises: [
      { name: 'Pull-up', image: pullUpImg },
      { name: 'Deadlift', image: deadliftImg },
      { name: 'Row', image: rowImg },
      { name: 'Lat Pull-down', image: latPullImg }
    ]
  },
  {
    muscle: 'Chest',
    exercises: [
      { name: 'Push-up', image: pushUpImg },
      { name: 'Bench Press', image: benchPressImg },
      { name: 'Incline Press', image: inclinePressImg },
      { name: 'Chest Fly', image: chestFlyImg }
    ]
  }
];

export default function ExerciseLibrary() {
  return (
    <div dir="rtl" style={{ padding: '20px' }}>
      <h1>Exercise Library</h1>
      <table border="1" cellPadding="10" style={{ width: '100%', textAlign: 'center' }}>
        <thead>
          <tr>
            <th>Muscle Group</th>
            <th colSpan="4">Exercises</th>
          </tr>
        </thead>
        <tbody>
          {exerciseData.map((row, index) => (
            <tr key={index}>
              <td><strong>{row.muscle}</strong></td>
              {row.exercises.map((exercise, i) => (
                <td key={i}>
                  <div>{exercise.name}</div>
                  <img src={exercise.image} alt={exercise.name} width="100" height="100" />
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
